<h1>Selection des colonnes</h1>
<p>Il est possible de sélectionner plusieurs colonnes en maintenant la touche <code>Ctrl</code> enfoncée, puis en cliquant colonne par colonnes ou en restant appuyé sur le clique gauche et en glissant sur les colonnes à conserver.</p>
